-- Borrar la tabla afiliados si existe
DROP TABLE IF EXISTS affiliates;

-- Tabla afiliados
CREATE TABLE affiliates (
    id_asociate INT PRIMARY KEY AUTO_INCREMENT,
    afiliate_code INT NOT NULL UNIQUE,
    afiliate_name VARCHAR(200) NOT NULL,
    dni VARCHAR(20) NOT NULL UNIQUE,
    gender VARCHAR (1) NOT NULL,
    retirement_file INT(10) NOT NULL UNIQUE,
    entry_date DATE,
    address_name VARCHAR(200),
    area VARCHAR(100), 
    province VARCHAR(20),
    code_post INT(4),
    phone VARCHAR(15),
    email VARCHAR(100) UNIQUE, 
    sector_id INT,
    has_children BOOLEAN,   
    has_discapacity BOOLEAN, 
    FOREIGN KEY (sector_id) REFERENCES sectors(sector_id) 
);

